import React from 'react'

function NameList() {
    const persons = [
        {
            id: 1,
            name: 'Pugal',
            age: 55,
            skill: "Angular"
        },
        {
            id: 2,
            name: 'Mukundan',
            age: 54,
            skill: "React"
        },
        {
            id: 3,
            name: 'Shekar',
            age: 35,
            skill: "Java"
        }
    ]
    const personList =  persons.map(person => (
        <h2>
            I am {person.name} and I am {person.age}, I know {person.skill}
        </h2>
    ))
    return (
        <div>
            {personList}
        </div>
    )
}

export default NameList
